ing Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"high":1228779816.6284628,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF","#acacFF","#ababFF","#aaaaFF","#a9a9FF","#a8a8FF","#a7a7FF","#a6a6FF","#a5a5FF","#a4a4FF","#a3a3FF","#a2a2FF","#a1a1FF","#a0a0FF","#9f9fFF","#9e9eFF","#9d9dFF","#9c9cFF","#9b9bFF","#9a9aFF","#9999FF","#9898FF","#9797FF","#9696FF","#9595FF","#9494FF","#9393FF","#9292FF","#9191FF","#9090FF","#8f8fFF","#8e8eFF","#8d8dFF","#8c8cFF","#8b8bFF","#8a8aFF","#8989FF","#8888FF","#8787FF","#8686FF","#8585FF","#8484FF","#8383FF","#8282FF","#8181FF","#8080FF","#7f7fFF","#7e7eFF","#7d7dFF","#7c7cFF","#7b7bFF","#7a7aFF","#7979FF","#7878FF","#7777FF","#7676FF","#7575FF","#7474FF","#7373FF","#7272FF","#7171FF","#7070FF","#6f6fFF","#6e6eFF","#6d6dFF","#6c6cFF","#6b6bFF","#6a6aFF","#6969FF","#6868FF","#6767FF","#6666FF","#6565FF","#6464FF","#6363FF","#6262FF","#6161FF","#6060FF","#5f5fFF","#5e5eFF","#5d5dFF","#5c5cFF","#5b5bFF
